import React from "react";

const Sci=(props)=>{
    const {scifi}=props;

    const url="http://image.tmdb.org/t/p/w185";
    return(
        <>
           {
               scifi.map((scimovie)=>(
                <div className="center-box">
                <img src={url + scimovie.poster_path} alt="top"/>
            </div> 
               ))
           }

        </>
    );
}
export default Sci;
